#https://leetcode.com/problems/jump-game-iv/submissions/

import sys
from collections import defaultdict
from functools import lru_cache
import heapq

class Node(object):
    def __init__(self, node, dist):
        self.nodeindex = node
        self.dist = dist

    def __repr__(self):
        return f'Node value: {self.val}'

    def __lt__(self, other):
        return self.dist < other.dist

class Solution:
    def minJumps(self, arr):
        def optimize(neighs):
            neighs = sorted(neighs)
            newneights = [neighs[0]]
            prev = neighs[0]

            for ind in neighs:
                if ind != prev and ind != prev+1:
                    newneights.append(ind)
                    
                prev = ind

            newneights.append(prev)

            return newneights

        n = len(arr)
        if n <= 2: return max(n-1, 0)
        
        # prepare adj list
        samenums = defaultdict(list)
        adjlist = defaultdict(list)
        for i,num in enumerate(arr):
            samenums[num].append(i)

        # optimize the samenums
        for i,num in enumerate(arr):
            samenums[num] = optimize(samenums[num])

        for i in range(n):
            edges = []
            if i-1 >= 0: edges.append(i-1)
            if i+1 < n: edges.append(i+1)
            edges += samenums[arr[i]]
            if i in edges: edges.remove(i)
            adjlist[i] = set(edges)

        # now run shortest path algo from 0 to n-1
        queue = []
        heapq.heappush(queue, Node(0, 0))
        shortest = [sys.maxsize] * n
        shortest[0] = 0
        
        while len(queue) > 0:
            node = heapq.heappop(queue)
            index, dist = node.nodeindex, node.dist

            for neigh in adjlist[index]:
                if dist + 1 < shortest[neigh]:
                    shortest[neigh] = dist+1
                    heapq.heappush(queue, Node(neigh, dist+1))

        return shortest[n-1]

